    result = source.filter_on_cdr3_bounding_aas(df)
    assert result.equals(pd.DataFrame({
        'amino_acid': ['CF', 'CYV', 'CYF']
    })), 'The function did not return the expected result'

# Run the test
test_filter_on_cdr3_bounding_aas()

