def remove_noise_char(s):
    stack = []
    result = ""
    for char in s:
        if char == "(":
            stack.append(char)
            result += char
        elif char == ")":
            while stack and stack[-1] != "(":
                result = result[:-1]
                stack.pop()
            if stack:
                stack.pop()
        else:
            result += char
    return result

