def findpeptide(pep, seq):


    ng = seq.replace('-', '')
    ngInd = ng.find(pep)
    ngCount = 0
    pos = 0

    while ngCount < ngInd or seq[pos] == '-':
        if not seq[pos] == '-':
            ngCount += 1
        pos += 1
    startPos = ngInd + (pos - ngCount)

    if startPos == -1:
        endPos = -1
    else:
        count = 0
        endPos = startPos
        while count < len(pep):
            if not seq[endPos] == '-':
                count += 1
            endPos += 1
    return startPos, endPos

def first_is_higher(v1, v2):

    v1_split = v1.split('.')
    v2_split = v2.split('.')
    higher = len(v1_split) < len(v2_split)
    i = 0
    max = len(v1_split)
    if len(v2_split) < max:
        max = len(v2_split)
    while i < max:
        v1_node = v1_split[i]
        v2_node = v2_split[i]
        if v1_node.isdigit() and v2_node.isdigit():
            v1_node = int(v1_node)
            v2_node = int(v2_node)
        if v1_node > v2_node:
            return True
        if v2_node > v1_node:
            return False
        i += 1
    return higher

def overlap(indices1, indices2):

    if not (len(indices1) == 2 and len(indices2) == 2):
        return False
    if indices2[0] <= indices1[0] <= indices2[1]:
        return True
    elif indices2[0] <= indices1[1] <= indices2[1]:
        return True
    else:
        return False

