def loss(K, y, alpha, L, h=0.5):

    _, n = K.shape

    z = 1 - y.reshape(-1,1) * K @ alpha
    z[(z < h) & (z > -h)] = ((z[(z < h) & (z > -h)] + h) ** 2) / (4 * h)
    z[z < -h] = 0

    return L * alpha.T @ K @ alpha + (1 / n) * z.sum()

