    while left <= right:
        mid = (left + right) // 2
        if a[mid - 1] < a[mid] and a[mid] > a[mid + 1]:
            return mid
        elif a[mid - 1] < a[mid] < a[mid + 1]:
            left = mid + 1
        elif a[mid - 1] > a[mid] > a[mid + 1]:
            right = mid - 1
        else:
            left += 1

    return 0

